import React from 'react';
import Header from '../../Shared/Header/Header';
import NewsFeed from '../NewsFeed/NewsFeed';
import SidebarLeft from '../SidebarLeft/SidebarLeft';
import SidebarRight from '../SidebarRight/SidebarRight';
import './Home.css';

const Home = () => {
    return (
        <div className="home">
            <Header />
            <SidebarLeft />
            <SidebarRight />
            <NewsFeed />
        </div>
    );
};

export default Home;
